import React from 'react';
import { connect } from 'react-redux';
import SideBar from './StuffComponents/SideBar';
import * as TYPES from './Redux/Actions/actionTypes';
import ClientsList from './StuffComponents/Clients';
import MaterialsList from './StuffComponents/Materials';
import ServicesList from './StuffComponents/Services';
import OrdersList from './StuffComponents/Orders';
import SchedulesList from './StuffComponents/Schedules';
import ProfilesList from './StuffComponents/Profiles';
import PromosList from './StuffComponents/Promos';
import FeedbacksList from './StuffComponents/Feedbacks';
import EmployeesList from './StuffComponents/Emoloyees';
import SpecializationsList from './StuffComponents/Specializations';
import QualificationsList from './StuffComponents/Qualifications';

class StaffMainMenu extends React.PureComponent {
  render() {
    var activeOption;
    switch (this.props.activeMenu) {
      case TYPES.CLIENTS_FETCH_DATA_SUCCESS:
        activeOption = <ClientsList />;
        break;

      case TYPES.MATERIALS_FETCH_DATA_SUCCESS:
        activeOption = <MaterialsList />;
        break;

      case TYPES.SERVICES_FETCH_DATA_SUCCESS:
        activeOption = <ServicesList />;
        break;

      case TYPES.ORDERS_FETCH_DATA_SUCCESS:
        activeOption = <OrdersList />;
        break;

      case TYPES.SHCEDULES_FETCH_DATA_SUCCESS:
        activeOption = <SchedulesList />;
        break;

      case TYPES.PROFILES_FETCH_DATA_SUCCESS:
        activeOption = <ProfilesList />;
        break;

      case TYPES.PROMOS_FETCH_DATA_SUCCESS:
        activeOption = <PromosList />;
        break;

      case TYPES.FEEDBACKS_FETCH_DATA_SUCCESS:
        activeOption = <FeedbacksList />;
        break;

      case TYPES.STAFFS_FETCH_DATA_SUCCESS:
        activeOption = <EmployeesList />;
        break;

      case TYPES.SPECIALIZATIONS_FETCH_DATA_SUCCESS:
        activeOption = <SpecializationsList />;
        break;

      case TYPES.QUALIFICATION_FETCH_DATA_SUCCESS:
        activeOption = <QualificationsList />;
        break;

      // case TYPES.MEDIAFILES_FETCH_DATA_SUCCESS:
      //   activeOption = <Media
      //   break;

      // case TYPES.MANUFACTURER_FETCH_DATA_SUCCESS:
      //   activeOption = <Mamufacturers/>
      //   break;

      default:
        break;
    }
    return (
      <>
        <div mainWindow>
          <div>
            <SideBar />
          </div>
          <div>{activeOption}</div>
        </div>
      </>
    );
  }
}

function mapStateToProps(state) {
  return {
    activeMenu: state.activeMenu,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(StaffMainMenu);
